    <div class=""col-lg-12 col-md-12 col-sm-12"">
        <h6>用npm包管理工具下载并全局安装bower：npm install -g bower</h6>
        <h6>全局安装bower 后，可以查看Bower的帮助信息，使用命令：bower help</h6>
        <h6>初始化当前工程的bower，此操作会在当前目录下生成bower.json文件：bower init</h6>
        <h6>bower的使用如下</h6>
        <h6>
            a、使用了bower的项目都会在目录下有一个bower.json文件。在该文件同级目录下，使用如下命令即可安装相关依赖库：bower install  注：bower下载安装依赖库实际上是使用git进行下载。对于linux系统，由于默认都有安装git，所以一般没问题。但是windows系统一般没有git。在windows系统下需要确定安装了git客户端，建议使用同捆的git bash命令行来执行bower install命令。或者把git目录加入windows的环境变量中，再在命令行中执行bower install命令。
        </h6>
        <h6>");
            WriteLiteral(@"使用bower安装某个特定类库或多个，例如jquery或bootstrap  小写： bower install jquery / bower install bootstrap或多个bower install jquery bootstrap</h6>
        <h6>使用bower更新 如： bower update jquery</h6>
        <h6>使用bower卸载 如： bower uninstall jquery （前提条件未被引用）</h6>
        <h6>为了方便管理 添加.bowerrc文件 设置目录。默认会安装在如 执行bower install jquery underscore bootstrap 文件会在  ./bower_components/文件夹下 </h6>
