        <h6>  引入required模块：我们可以使用require指令来载入Node.js模块。</h6>
        <h6> 创建服务器：服务器可以监听客户端的请求，类似于Apache 、Nginx等HTTP服务器。 </h6>
        <h6> 接收请求与响应请求：服务器很容易创建，客户端可以使用浏览器或终端发送HTTP请求，服务器接收请求后返回响应数据。</h6>
        <h6>引入required模块，我们使用require指令来载入http模块，并将实例化的HTTP赋值给变量http，实例如下: demo.js");
            WriteLiteral(@"文件添加如下代码</h6>
<pre>
var http = require(""http"");
http.createServer(function(request,respone){
    respone.writeHead(200,{'Content-Type':'text/plain'});
    respone.end(""Hello World!\n"");
}).listen(9999);
console.log(""Server running at http://127.0.0.1:9999/"");

当前目录下执行：node demo.js
</pre>
